// SPDX-License-Identifier: Unlicensed
pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

import '../interfaces/IERC20.sol';
import "../open/utils/Initializable.sol";
import "../open/token/ERC721/IERC721.sol";
import "../open/token/ERC721/utils/ERC721Holder.sol";
import "../open/utils/Ownable.sol";


contract Nsell is ERC721Holder,Initializable,Ownable{

    IERC721 public nToken;
    IERC20 public payToken;

    uint256 internal _minDurationTime = 2 * 60 * 60;

    address internal feeAddress;      //

    uint internal ORDER_ID;

    struct Eaise{
        uint256 price;      //
        uint256 fee;        //
        address bidder;     //
        uint256 timestamp;  //
    }

    struct SalesObject {
        uint256 id;             //ID
        uint256 tokenId;        //
        uint256 startTime;      //
        uint256 durationTime;   //
        uint256 startPrice;     //
        uint8 status;           //
        address seller;         //
        uint256 award;          //
    }

    uint internal eaiseRange = 10;    //

    mapping( uint256 => Eaise[]) eaises;    //

    uint256 internal bidderFeeRate = 20;     //
    uint256 internal sellerFeeRate = 3;      //

    mapping( uint => SalesObject) public acutionOrderMap;  //

    uint[] acutionIds;      //

    //id => index
    mapping( uint => uint) internal acutionId2Indexs;

    mapping(address => uint[]) userAcutionIds;  //

    //id = > index
    mapping( uint => uint) internal userAcutionId2Indexs;

    constructor() public {}

    function initialize(
        address _nToken,
        address _payToken,
        address _feeAddress,
        address _ownerAddress
    ) public initializer {
        nToken = IERC721(_nToken);
        payToken = IERC20(_payToken);
        _owner = _ownerAddress;
        bidderFeeRate = 20;
        sellerFeeRate = 3;
        eaiseRange = 10;
        ORDER_ID = 10000;
        _minDurationTime = 2 * 60 * 60;
        feeAddress = _feeAddress;
    }


    //
    function getSales(
            uint start,
            uint end) external view returns(
                SalesObject[] memory _orders,
                uint count) {

        count = acutionIds.length;

        if( end > count ) end = count - 1;

        if( end >= start ){
            uint size = end - start + 1;

            _orders = new SalesObject[](size);

            for( (uint i,uint k) = (start,0); i <= end && k < size; (i++,k ++) ){

                _orders[k] = acutionOrderMap[acutionIds[i]];
            }
        }
    }

    //
    function getUserSales() external view returns(SalesObject[] memory _order) {

        uint[] storage ids  = userAcutionIds[msg.sender];

        uint len = ids.length;

        _order = new SalesObject[](len);

        for( uint i = 0; i < len; i++ ){
            _order[i] = acutionOrderMap[ids[i]];
        }
    }

    //
    function getEaises(uint orderId)external view returns(Eaise[] memory){
        return eaises[orderId];
    }

    //
    function sell(
            uint256 tokenId,        //
            uint256 startPrice,     //
            uint256 startTime,      //
            uint256 durationTime    //
            )external {

        require(startTime + durationTime > block.timestamp, "invalid start time");
        require(durationTime >= _minDurationTime, "invalid duration");
        require(startPrice > 0, "invalid price");

        nToken.safeTransferFrom(msg.sender,address(this),tokenId);

        uint[] storage myIds = userAcutionIds[msg.sender];

        require(myIds.length <= 5,"too many order");

        uint id =  ORDER_ID;

        acutionOrderMap[id] =  SalesObject(
            id,
            tokenId,
            startTime,
            durationTime,
            startPrice,
            0,
            msg.sender,
            0
        );

        //
        uint len = acutionIds.length;
        acutionIds.push(id);
        acutionId2Indexs[id] = len;

        //
        len = myIds.length;
        myIds.push(id);
        userAcutionId2Indexs[id] = len;

        ORDER_ID ++;
    }

    //
    function eaise(uint orderId)external  {

        SalesObject storage obj = acutionOrderMap[orderId];
        require(obj.status == 0, "bad status");
        //
        //
        require(obj.startTime + obj.durationTime > block.timestamp, "end");

        require(obj.seller != msg.sender,"oneself");


        Eaise[] storage eaiseArr = eaises[obj.id];

        uint len = eaiseArr.length;

        uint256 price = obj.startPrice;
        uint256 eaisePrice = 0;

        if( len > 0 ){
            Eaise storage e = eaiseArr[len - 1];
            eaisePrice = e.price * eaiseRange / 100;
            price = e.price + eaisePrice;
        }

        payToken.transferFrom(msg.sender, address(this), price);

        if( eaisePrice > 0 ){
            //
            uint bidderAmount = eaisePrice * 20 / 100;
            //
            uint publisherAmount = eaisePrice * 80 / 100;

            //
            uint fee = bidderAmount * 20 / 100;
            //
            uint bidderAward = bidderAmount * 80 / 100;

            obj.award += publisherAmount;

            Eaise storage bidder = eaiseArr[len - 1];

            //
            payToken.transfer(feeAddress, fee);
            //  
            payToken.transfer(bidder.bidder, bidder.price + bidderAward);
        }

        eaiseArr.push( Eaise(price,eaisePrice,msg.sender,block.timestamp));

        if( obj.startTime + obj.durationTime - block.timestamp < 600 ){
            obj.durationTime += 600;
        }
    }


    //
    function finishOrder(uint orderId)external{

        SalesObject storage obj = acutionOrderMap[orderId];

        require(obj.status == 0, "bad status");

        require(obj.seller == msg.sender,"not owner");

        obj.status = 1;

        require(obj.startTime + obj.durationTime < block.timestamp, "not end");

        Eaise[] storage eaiseArr = eaises[obj.id];

        uint len = eaiseArr.length;

        if( len > 0 ){

            Eaise storage e = eaises[orderId][len - 1];

            nToken.safeTransferFrom(address(this),e.bidder,obj.tokenId);

            uint award = obj.award;
            uint fee = award * sellerFeeRate / 100;
            payToken.transfer( feeAddress, fee);

            uint amount = ( award - fee )+ obj.startPrice;

            payToken.transfer( obj.seller, amount);

        }else{
            nToken.safeTransferFrom(address(this),obj.seller,obj.tokenId);
        }
        _updateAcutionOrder(obj.id,obj.seller);
    }

    function _updateAcutionOrder(uint orderId,address owner)internal{

        uint len1 = acutionIds.length;
        uint index1 = acutionId2Indexs[orderId];

        acutionIds[index1] = acutionIds[len1-1];
        delete acutionIds[len1 - 1];
        acutionIds.pop();

        if( index1 != len1 - 1 ){
            acutionId2Indexs[acutionId2Indexs[index1]] = index1;
        }

        uint[] storage ids = userAcutionIds[owner];

        uint len2 = ids.length;

        uint index2 = userAcutionId2Indexs[orderId];

        ids[index2] = ids[len2 - 1];
        delete userAcutionIds[owner][len2 - 1];
        userAcutionIds[owner].pop();

        if( index2 != len2 - 1){
            userAcutionId2Indexs[ids[index2]] = index2;
        }
    }
}
